import React from "react";
import "./style.css";

const Home = () => {
  return (
      <>
      <div className="error_page">
      <h1>404 Page Not Found</h1>
      <a href="/">GO TO HOME PAGE</a>
      </div>

      </>
  );
};
export default Home;
